import styled from "styled-components/native"

export const FirstView5 = styled.View`
flex-direction: row;
align-items: center;
display: flex;
`;

export const BigText4 = styled.Text`
font-family: 'Roboto';
font-style: normal;
font-weight: 300;
font-size: 24px;
line-height: 28px;
text-align: center;
color: #C3AD60;
`;

export const SecondView4 = styled.View`
margin-top: 55px;
align-items: center;
justify-content: center;
`;

export const Quantity1 = styled.View`

background-color: rgba(78,78,78,0.5);
flex-direction: row;
align-items: center;
align-self:flex-end;
justify-content:center;
border-radius: 15px;
width:72px;
height:32px;
positon: absolute;
top: -65px;
left: 15px
`;

export const QtyText1 = styled.Text`
font-family: 'Roboto';
font-style: normal;
font-weight: 300;
font-size: 14px;
line-height: 16px;
letter-spacing: -0.333333px;
color: #FFFFFF;
`;

export const ButtonText1 = styled.Text`
font-family: 'Roboto';
font-style: normal;
font-weight: 300;
font-size: 18px;
line-height: 21px;
letter-spacing: -0.333333px;
color: #000000;
`
